export default function AdminDash() {
  return (
    <>
    <Grid container>
      <Grid item>
        <List component="nav" >
          <ListItem button divider>
            <ListItemText primary="View Users" />

          </ListItem>
        </List>

      </Grid>
      <Grid item>

      </Grid>
    </Grid>
    </>
  )
}
